<?php $__env->startSection('content'); ?><p>Her life has been filled with scandal and controversy since appearing on Married At First Sight in 2018.</p>

<p>But Tracey Jewel is finally getting her happy ending after falling pregnant to her high school sweetheart Nathan 'Nate' Constable.</p>

<p>In a new interview on former co-star Dean Wells' YouTube show Dangerous Ideas with Deano, the 37-year-old said that life's never been better.</p>

<p>'I went through a really hard time': Former Married At First Sight star Tracey Jewel (left) has opened up about life after MAFS and falling pregnant with boyfriend Nathan Constable (right)</p>

<p>'After MAFS I went through a really hard time with some anxiety and the readjustment and all of that,' she said.</p>

<p>'I bumped into Nate who was actually my high school boyfriend from 20 years ago, and two years later we're now happily pregnant and life is great, he's amazing.'</p>

<p>Tracey, who is already a mother to 10-year-old daughter Grace, also said that she's always wanted a second child, but 'didn't know if it was on the cards for me'.</p>

<p>The wellness entrepreneur announced her baby joy with Nathan on September 19.</p>

<p>'I bumped into Nate who was actually my high school boyfriend from 20 years ago, and two years later we're now happily pregnant and life is great, he's amazing,' she gushed. (Pictured with former MAFS co-star Dean Wells)</p>

<p>'We're having a baby! We are so happy to share our beautiful news with everyone,' she wrote on Instagram.</p>

<p>'I have always believed in second chances and my second baby I've been waiting so long for,' she added. </p>

<p>'My daughter Grace is going to be an amazing big sister and I'm so so grateful to be experiencing pregnancy and motherhood again with my love Nate x.'</p>

<p>Motherhood: Tracey, who is already a mother to 10-year-old daughter Grace, also said that she's always wanted a second child, but 'didn't know if it was on the cards for me'. (Pictured with Grace)</p>

<p>She also posted a picture of her ultrasound and a baby onesie that read: 'Coming soon.'</p>

<p>The baby is Tracey and Nathan's first child together. She shares her daughter Grace, nine, with her ex-husband, Jacob Anthonisz.</p>

<p>While the pregnancy may come as a surprise for some, Tracey revealed she wanted to have a child with Nathan in January last year.</p>

<p>'I definitely want more children, a hundred per cent! I'm only 36, I've got quite a few years left,' she told WHO magazine.</p>

<p>'I decided that going forward I definitely want kids so I need to be with someone where that's an option. That door is open and that's really important to me.'</p>

<p>'We're having a baby! We are so happy to share our beautiful news with everyone': Tracey announced her pregnancy earlier this month </p>
